import React, { useState } from 'react'
import './Singup.scss'

export default function Singup() {
  const [formData,setFormData] = useState({
    fullname:"",
    password:"",
    email:"",
  });

  const handleChange = (e) =>{
    setFormData({...formData,[e.target.name]:e.target.value});
  };

  const handleSubmit = async (e) =>{
    e.preventDefault();
    try{
      const response = await fetch("",{
        method : "POST",
        headers:{
          "Content-Type":"application/json",
        },
        body:JSON.stringify(formData),
      });
      const result = await response.json();
      console.log(result);

      if(response.ok){
        alert("singup successfull");
      }else{
        alert("singup failed"+result.message);
      }
    }catch(error){
      console.log("Error:",error)
    }
  };
  return (
    <>
    <div className="container-fluid" id='singup-form'>
        <div className="container">
          <div class="login-page">
            <div class="form">
              <form class="login-form" action='POST' onSubmit={handleSubmit}>
                <input type="text" placeholder="fullname" name="fullname" value={formData.fullname} onChange={handleChange}/>
                <input type="password" placeholder="password" name="password" value={formData.password} onChange={handleChange}/>
                <input type="email" placeholder="email address" name="email" value={formData.email} onChange={handleChange}/>
                <button className='btn-info' value="submit" type='submit'>create</button>
                <p class="message">
                  Already registered? <a href="/login" className='text-info'>Sign In</a>
                </p>
              </form>
            </div>
          </div>
        </div>
      </div>
    </>
  )
}
